import React from 'react';
import 'bootstrap/dist/css/bootstrap.min/css';
import { Navbar, Row, Col, Alert, Container } from 'react-bootstrap';

export default function RowColAlerts() {
  return (
    <>
      <Navbar></Navbar>
      <Container>
        <Row>
          <Col>
            <h2>컬럼 1번</h2>
          </Col>
          <Col>
            <h2>컬럼 2번</h2>
          </Col>
        </Row>
      </Container>
      <Alert>
        <Alert.Heading>알람 성공</Alert.Heading>
        <p>이것은 알람이여~</p>
      </Alert>
    </>
  );
}
